import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Router from './Router';

// First, try to render a simple test component
const TestApp = () => {
  console.log('Rendering TestApp');
  return (
    <div style={{
      backgroundColor: 'green',
      color: 'white',
      padding: '20px',
      fontSize: '24px',
      textAlign: 'center'
    }}>
      TEST APP IS RENDERING
    </div>
  );
};

console.log('Starting React app...');
console.log('Root element:', document.getElementById('root'));

const root = ReactDOM.createRoot(document.getElementById('root'));

// First render the test app
root.render(
  <React.StrictMode>
    <TestApp />
  </React.StrictMode>
);

// Then after a delay, render the real app
setTimeout(() => {
  console.log('Rendering main Router component');
  root.render(
    <React.StrictMode>
      <Router />
    </React.StrictMode>
  );
}, 1000);
